import Navbar from './navbar';
import Home from './Home';

// function App() {
//   return (
//     <div className="App">
//         <Navbar />
//       <div className="contents">
//          <Home />
//       </div>

//     </div>
//   );
// }


const App = () => {
    return (
      <div style={{ display: 'flex', height: '100vh' }}>
        {/* Sidebar */}
        <div style={{ width: '25%', backgroundColor: '#f8f8f8', padding: '20px', boxShadow: '2px 0 5px rgba(0, 0, 0, 0.1)', display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
          <img src="https://via.placeholder.com/80" alt="User Profile" style={{ width: '80px', height: '80px', borderRadius: '50%', marginBottom: '10px' }} />
          <h2>Name's Health Companion</h2>
          <button style={{ backgroundColor: '#000', color: '#fff', border: 'none', padding: '10px 20px', fontSize: '16px', cursor: 'pointer', borderRadius: '5px', marginTop: '20px' }}>View My Healthcard</button>
        </div>

        {/* Chat Area */}
        <div style={{ flex: 1, display: 'flex', flexDirection: 'column', justifyContent: 'space-between', padding: '20px' }}>
          {/* Chat Messages */}
          <div style={{ flex: 1, overflowY: 'auto', display: 'flex', flexDirection: 'column', gap: '20px' }}>
            <div style={{ display: 'flex', justifyContent: 'flex-end', alignItems: 'center', gap: '10px' }}>
              <div style={{ backgroundColor: '#e3f2fd', padding: '10px 15px', borderRadius: '10px', maxWidth: '60%', textAlign: 'right' }}>I have a runny nose...</div>
              <img src="https://via.placeholder.com/40" alt="User" style={{ width: '40px', height: '40px', borderRadius: '50%' }} />
            </div>
            <div style={{ display: 'flex', justifyContent: 'flex-start', alignItems: 'center', gap: '10px' }}>
              <img src="https://via.placeholder.com/40" alt="Bot" style={{ width: '40px', height: '40px', borderRadius: '50%' }} />
              <div style={{ backgroundColor: '#fbe9e7', padding: '10px 15px', borderRadius: '10px', maxWidth: '60%' }}>I recommend...</div>
            </div>
            <div style={{ display: 'flex', justifyContent: 'flex-end', alignItems: 'center', gap: '10px' }}>
              <div style={{ backgroundColor: '#e3f2fd', padding: '10px 15px', borderRadius: '10px', maxWidth: '60%', textAlign: 'right' }}>Where can I get...</div>
              <img src="https://via.placeholder.com/40" alt="User" style={{ width: '40px', height: '40px', borderRadius: '50%' }} />
            </div>
            <div style={{ display: 'flex', justifyContent: 'flex-start', alignItems: 'center', gap: '10px' }}>
              <img src="https://via.placeholder.com/40" alt="Bot" style={{ width: '40px', height: '40px', borderRadius: '50%' }} />
              <div style={{ backgroundColor: '#fbe9e7', padding: '10px 15px', borderRadius: '10px', maxWidth: '60%' }}>This is found...</div>
            </div>
          </div>

          {/* Input and Button Section */}
          <div style={{ marginTop: '20px', display: 'flex', flexDirection: 'column', gap: '10px' }}>
            <input type="text" placeholder="How can MediCompanion help?" style={{ padding: '10px', fontSize: '16px', border: '1px solid #ddd', borderRadius: '5px', flex: 1 }} />
            <div style={{ display: 'flex', gap: '10px' }}>
              <button style={{ padding: '10px 20px', fontSize: '14px', border: 'none', borderRadius: '5px', backgroundColor: '#ddd', cursor: 'pointer' }}>Prescriptions...</button>
              <button style={{ padding: '10px 20px', fontSize: '14px', border: 'none', borderRadius: '5px', backgroundColor: '#ddd', cursor: 'pointer' }}>Vaccines...</button>
              <button style={{ padding: '10px 20px', fontSize: '14px', border: 'none', borderRadius: '5px', backgroundColor: '#ddd', cursor: 'pointer' }}>I feel sick...</button>
            </div>
          </div>
        </div>
      </div>
    );
  };

  export default App;

//
